import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import GameDashboard from './components/GameDashboard';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/game/:username" element={<GameDashboard />} />
        <Route path="/" element={<h1>Welcome to the Bingo Game App</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
